            array('id' => '212', 'pos_name' => 'Electrical and Electronic Engineering Technicians', 'pos_description' => 'Apply electrical and electronic theory and related knowledge, usually under the direction of engineering staff, to design, build, repair, calibrate, and modify electrical components, circuitry, controls, and machinery for subsequent evaluation and use by engineering staff in making engineering design decisions.', 'soc_code' => '17-3023.00', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
