            array('id' => '214', 'pos_name' => 'Electrical Engineering Technicians', 'pos_description' => 'Test or modify developmental or operational electrical machinery or electrical control equipment and circuitry in industrial or commercial plants or laboratories. Usually work under direction of engineers or technologists.', 'soc_code' => '17-3023.03', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'electrical-engineering-tech', 'is_active' => '1', 'def_title_id' => '13456', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '215', 'pos_name' => 'Electro-Mechanical Technicians', 'pos_description' => 'Operate, test, maintain, or calibrate unmanned, automated, servo-mechanical, or electromechanical equipment. May operate unmanned submarines, aircraft, or other equipment at worksites, such as oil rigs, deep ocean exploration, or hazardous waste removal. May assist engineers in testing and designing robotics equipment.', 'soc_code' => '17-3024.00', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'electronic-tech', 'is_active' => '1', 'def_title_id' => '13628', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '216', 'pos_name' => 'Robotics Technicians', 'pos_description' => 'Build, install, test, or maintain robotic equipment or related automated production systems.', 'soc_code' => '17-3024.01', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'robotics-tech', 'is_active' => '1', 'def_title_id' => '33705', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '217', 'pos_name' => 'Environmental Engineering Technicians', 'pos_description' => 'Apply theory and principles of environmental engineering to modify, test, and operate equipment and devices used in the prevention, control, and remediation of environmental problems, including waste treatment and site remediation, under the direction of engineering staff or scientist. May assist in the development of environmental remediation devices.', 'soc_code' => '17-3025.00', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'environmental-technician', 'is_active' => '1', 'def_title_id' => '14236', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '218', 'pos_name' => 'Industrial Engineering Technicians', 'pos_description' => 'Apply engineering theory and principles to problems of industrial layout or manufacturing production, usually under the direction of engineering staff. May perform time and motion studies on worker operations in a variety of industries for purposes such as establishing standard production rates or improving efficiency.', 'soc_code' => '17-3026.00', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'industrial-engineering-tech', 'is_active' => '1', 'def_title_id' => '24301', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '219', 'pos_name' => 'Mechanical Engineering Technicians', 'pos_description' => 'Apply theory and principles of mechanical engineering to modify, develop, test, or calibrate machinery and equipment under direction of engineering staff or physical scientists.', 'soc_code' => '17-3027.00', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'mechanical-tech', 'is_active' => '1', 'def_title_id' => '24879', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '220', 'pos_name' => 'Automotive Engineering Technicians', 'pos_description' => 'Assist engineers in determining the practicality of proposed product design changes and plan and carry out tests on experimental test devices or equipment for performance, durability, or efficiency.', 'soc_code' => '17-3027.01', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'automotive-engineering-tech', 'is_active' => '1', 'def_title_id' => '2584', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '221', 'pos_name' => 'Engineering Technicians, Except Drafters, All Other', 'pos_description' => 'All engineering technicians, except drafters, not listed separately.', 'soc_code' => '17-3029.00', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '222', 'pos_name' => 'Non-Destructive Testing Specialists', 'pos_description' => 'Test the safety of structures, vehicles, or vessels using x-ray, ultrasound, fiber optic or related equipment.', 'soc_code' => '17-3029.01', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '223', 'pos_name' => 'Electrical Engineering Technologists', 'pos_description' => 'Assist electrical engineers in such activities as process control, electrical power distribution, or instrumentation design. May prepare layouts of electrical transmission or distribution systems, supervise the flow of work, estimate project costs, or participate in research studies.', 'soc_code' => '17-3029.02', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'electrical-technologist', 'is_active' => '1', 'def_title_id' => '13457', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '224', 'pos_name' => 'Electromechanical Engineering Technologists', 'pos_description' => 'Assist electromechanical engineers in such activities as computer-based process control, instrumentation, or machine design. May prepare layouts of machinery or equipment, plan the flow of work, conduct statistical studies, or analyze production costs.', 'soc_code' => '17-3029.03', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'electromechanical-technologist', 'is_active' => '1', 'def_title_id' => '13574', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '225', 'pos_name' => 'Electronics Engineering Technologists', 'pos_description' => 'Assist electronics engineers in such activities as electronics systems and instrumentation design or digital signal processing.', 'soc_code' => '17-3029.04', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'electronic-technologist', 'is_active' => '1', 'def_title_id' => '13695', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '226', 'pos_name' => 'Industrial Engineering Technologists', 'pos_description' => 'Assist industrial engineers in such activities as quality control, inventory control, or material flow methods. May conduct statistical studies or analyze production costs.', 'soc_code' => '17-3029.05', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'industrial-engineer', 'is_active' => '1', 'def_title_id' => '20637', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '227', 'pos_name' => 'Manufacturing Engineering Technologists', 'pos_description' => 'Develop tools, implement designs, or integrate machinery, equipment, or computer technologies to ensure effective manufacturing processes.', 'soc_code' => '17-3029.06', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'manufacture-technologist', 'is_active' => '1', 'def_title_id' => '24285', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '228', 'pos_name' => 'Mechanical Engineering Technologists', 'pos_description' => 'Assist mechanical engineers in such activities as generation, transmission, or use of mechanical or fluid energy. Prepare layouts of machinery or equipment or plan the flow of work. May conduct statistical studies or analyze production costs.', 'soc_code' => '17-3029.07', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'mechanical-technologist', 'is_active' => '1', 'def_title_id' => '24848', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '229', 'pos_name' => 'Photonics Technicians', 'pos_description' => 'Build, install, test, or maintain optical or fiber optic equipment, such as lasers, lenses, or mirrors, using spectrometers, interferometers, or related equipment.', 'soc_code' => '17-3029.08', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'photonics-technician', 'is_active' => '1', 'def_title_id' => '29308', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '230', 'pos_name' => 'Manufacturing Production Technicians', 'pos_description' => 'Set up, test, and adjust manufacturing machinery or equipment, using any combination of electrical, electronic, mechanical, hydraulic, pneumatic, or computer technologies.', 'soc_code' => '17-3029.09', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'manufacture-production', 'is_active' => '1', 'def_title_id' => '24296', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '231', 'pos_name' => 'Fuel Cell Technicians', 'pos_description' => 'Install, operate, or maintain integrated fuel cell systems in transportation, stationary, or portable applications.', 'soc_code' => '17-3029.10', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'fuel-cell-technician', 'is_active' => '1', 'def_title_id' => '16844', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '232', 'pos_name' => 'Nanotechnology Engineering Technologists', 'pos_description' => 'Implement production processes for nanoscale designs to produce or modify materials, devices, or systems of unique molecular or macromolecular composition. Operate advanced microscopy equipment to manipulate nanoscale objects. Work under the supervision of nanoengineering staff.', 'soc_code' => '17-3029.11', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'nanotechnologist', 'is_active' => '1', 'def_title_id' => '26540', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '233', 'pos_name' => 'Nanotechnology Engineering Technicians', 'pos_description' => 'Operate commercial-scale production equipment to produce, test, or modify materials, devices, or systems of molecular or macromolecular composition. Work under the supervision of engineering staff.', 'soc_code' => '17-3029.12', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'nanotechnology-technician', 'is_active' => '1', 'def_title_id' => '26541', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '234', 'pos_name' => 'Surveying and Mapping Technicians', 'pos_description' => 'Perform surveying and mapping duties, usually under the direction of an engineer, surveyor, cartographer, or photogrammetrist to obtain data used for construction, mapmaking, boundary location, mining, or other purposes. May calculate mapmaking information and create maps from source data, such as surveying notes, aerial photography, satellite data, or other maps to show topographical features, political boundaries, and other features. May verify accuracy and completeness of maps.', 'soc_code' => '17-3031.00', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '235', 'pos_name' => 'Surveying Technicians', 'pos_description' => 'Adjust and operate surveying instruments, such as the theodolite and electronic distance-measuring equipment, and compile notes, make sketches and enter data into computers.', 'soc_code' => '17-3031.01', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'surveying-technician', 'is_active' => '0', 'def_title_id' => '38564', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '236', 'pos_name' => 'Mapping Technicians', 'pos_description' => 'Calculate mapmaking information from field notes, and draw and verify accuracy of topographical maps.', 'soc_code' => '17-3031.02', 'major_gid' => '4', 'minor_gid' => '11', 'url_desc' => 'mapping-technician', 'is_active' => '1', 'def_title_id' => '24326', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '237', 'pos_name' => 'Animal Scientists', 'pos_description' => 'Conduct research in the genetics, nutrition, reproduction, growth, and development of domestic farm animals.', 'soc_code' => '19-1011.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'animal-scientist', 'is_active' => '1', 'def_title_id' => '1300', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '238', 'pos_name' => 'Food Scientists and Technologists', 'pos_description' => 'Use chemistry, microbiology, engineering, and other sciences to study the principles underlying the processing and deterioration of foods; analyze food content to determine levels of vitamins, fat, sugar, and protein; discover new food sources; research ways to make processed foods safe, palatable, and healthful; and apply food science knowledge to determine best ways to process, package, preserve, store, and distribute food.', 'soc_code' => '19-1012.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'food-scientist', 'is_active' => '1', 'def_title_id' => '16282', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '239', 'pos_name' => 'Soil and Plant Scientists', 'pos_description' => 'Conduct research in breeding, physiology, production, yield, and management of crops and agricultural plants or trees, shrubs, and nursery stock, their growth in soils, and control of pests; or study the chemical, physical, biological, and mineralogical composition of soils as they relate to plant or crop growth. May classify and map soils and investigate effects of alternative practices on soil and crop productivity.', 'soc_code' => '19-1013.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'soil-scientist', 'is_active' => '0', 'def_title_id' => '36678', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '240', 'pos_name' => 'Biologists', 'pos_description' => 'Research or study basic principles of plant and animal life, such as origin, relationship, development, anatomy, and functions.', 'soc_code' => '19-1020.01', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'biologist-plant-animal', 'is_active' => '1', 'def_title_id' => '3756', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '241', 'pos_name' => 'Biochemists and Biophysicists', 'pos_description' => 'Study the chemical composition or physical principles of living cells and organisms, their electrical and mechanical energy, and related phenomena. May conduct research to further understanding of the complex chemical combinations and reactions involved in metabolism, reproduction, growth, and heredity. May determine the effects of foods, drugs, serums, hormones, and other substances on tissues and vital processes of living organisms.', 'soc_code' => '19-1021.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'biochemist-biophysicist', 'is_active' => '1', 'def_title_id' => '3744', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '242', 'pos_name' => 'Microbiologists', 'pos_description' => 'Investigate the growth, structure, development, and other characteristics of microscopic organisms, such as bacteria, algae, or fungi. Includes medical microbiologists who study the relationship between organisms and disease or the effects of antibiotics on microorganisms.', 'soc_code' => '19-1022.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'microbiologist', 'is_active' => '1', 'def_title_id' => '25524', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '243', 'pos_name' => 'Zoologists and Wildlife Biologists', 'pos_description' => 'Study the origins, behavior, diseases, genetics, and life processes of animals and wildlife. May specialize in wildlife research and management. May collect and analyze biological data to determine the environmental effects of present and potential use of land and water habitats.', 'soc_code' => '19-1023.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'zoologist-biologist', 'is_active' => '0', 'def_title_id' => '42783', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '244', 'pos_name' => 'Biological Scientists, All Other', 'pos_description' => 'All biological scientists not listed separately.', 'soc_code' => '19-1029.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '245', 'pos_name' => 'Bioinformatics Scientists', 'pos_description' => 'Conduct research using bioinformatics theory and methods in areas such as pharmaceuticals, medical technology, biotechnology, computational biology, proteomics, computer information science, biology and medical informatics. May design databases and develop algorithms for processing and analyzing genomic information, or other biological information.', 'soc_code' => '19-1029.01', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '246', 'pos_name' => 'Molecular and Cellular Biologists', 'pos_description' => 'Research and study cellular molecules and organelles to understand cell function and organization.', 'soc_code' => '19-1029.02', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '247', 'pos_name' => 'Geneticists', 'pos_description' => 'Research and study the inheritance of traits at the molecular, organism or population level. May evaluate or treat patients with genetic disorders.', 'soc_code' => '19-1029.03', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'geneticist-research', 'is_active' => '1', 'def_title_id' => '17534', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '248', 'pos_name' => 'Conservation Scientists', 'pos_description' => 'Manage, improve, and protect natural resources to maximize their use without damaging the environment. May conduct soil surveys and develop plans to eliminate soil erosion or to protect rangelands. May instruct farmers, agricultural production managers, or ranchers in best ways to use crop rotation, contour plowing, or terracing to conserve soil and water; in the number and kind of livestock and forage plants best suited to particular ranges; and in range and farm improvements, such as fencing and reservoirs for stock watering.', 'soc_code' => '19-1031.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '249', 'pos_name' => 'Soil and Water Conservationists', 'pos_description' => 'Plan or develop coordinated practices for soil erosion control, soil or water conservation, or sound land use.', 'soc_code' => '19-1031.01', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '250', 'pos_name' => 'Range Managers', 'pos_description' => 'Research or study range land management practices to provide sustained production of forage, livestock, and wildlife.', 'soc_code' => '19-1031.02', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'range-manager', 'is_active' => '0', 'def_title_id' => '32406', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '251', 'pos_name' => 'Park Naturalists', 'pos_description' => 'Plan, develop, and conduct programs to inform public of historical, natural, and scientific features of national, state, or local park.', 'soc_code' => '19-1031.03', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'park-naturlist', 'is_active' => '1', 'def_title_id' => '28452', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '252', 'pos_name' => 'Foresters', 'pos_description' => 'Manage public and private forested lands for economic, recreational, and conservation purposes. May inventory the type, amount, and location of standing timber, appraise the timber&#039;s worth, negotiate the purchase, and draw up contracts for procurement. May determine how to conserve wildlife habitats, creek beds, water quality, and soil stability, and how best to comply with environmental regulations. May devise plans for planting and growing new trees, monitor trees for healthy growth, and determine optimal harvesting schedules.', 'soc_code' => '19-1032.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'forester-conserve', 'is_active' => '1', 'def_title_id' => '16433', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '253', 'pos_name' => 'Epidemiologists', 'pos_description' => 'Investigate and describe the determinants and distribution of disease, disability, or health outcomes. May develop the means for prevention and control.', 'soc_code' => '19-1041.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'epidemiologist', 'is_active' => '1', 'def_title_id' => '14309', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '254', 'pos_name' => 'Medical Scientists, Except Epidemiologists', 'pos_description' => 'Conduct research dealing with the understanding of human diseases and the improvement of human health. Engage in clinical investigation, research and development, or other related activities. Includes physicians, dentists, public health specialists, pharmacologists, and medical pathologists who primarily conduct research.', 'soc_code' => '19-1042.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => 'medical-scientist', 'is_active' => '1', 'def_title_id' => '25068', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '255', 'pos_name' => 'Life Scientists, All Other', 'pos_description' => 'All life scientists not listed separately.', 'soc_code' => '19-1099.00', 'major_gid' => '5', 'minor_gid' => '12', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '256', 'pos_name' => 'Astronomers', 'pos_description' => 'Observe, research, and interpret astronomical phenomena to increase basic knowledge or apply such information to practical problems.', 'soc_code' => '19-2011.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'astronomer', 'is_active' => '1', 'def_title_id' => '2118', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '257', 'pos_name' => 'Physicists', 'pos_description' => 'Conduct research into physical phenomena, develop theories on the basis of observation and experiments, and devise methods to apply physical laws and theories.', 'soc_code' => '19-2012.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'physicist-research', 'is_active' => '1', 'def_title_id' => '29393', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '258', 'pos_name' => 'Atmospheric and Space Scientists', 'pos_description' => 'Investigate atmospheric phenomena and interpret meteorological data, gathered by surface and air stations, satellites, and radar to prepare reports and forecasts for public and other uses. Includes weather analysts and forecasters whose functions require the detailed knowledge of meteorology.', 'soc_code' => '19-2021.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'atmospheric-space', 'is_active' => '1', 'def_title_id' => '2161', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '259', 'pos_name' => 'Chemists', 'pos_description' => 'Conduct qualitative and quantitative chemical analyses or experiments in laboratories for quality or process control or to develop new products or knowledge.', 'soc_code' => '19-2031.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'chemistry', 'is_active' => '1', 'def_title_id' => '7197', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '260', 'pos_name' => 'Materials Scientists', 'pos_description' => 'Research and study the structures and chemical properties of various natural and synthetic or composite materials, including metals, alloys, rubber, ceramics, semiconductors, polymers, and glass. Determine ways to strengthen or combine materials or develop new materials with new or specific properties for use in a variety of products and applications. Includes glass scientists, ceramic scientists, metallurgical scientists, and polymer scientists.', 'soc_code' => '19-2032.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'materials-scientist', 'is_active' => '1', 'def_title_id' => '24691', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '261', 'pos_name' => 'Environmental Scientists and Specialists, Including Health', 'pos_description' => 'Conduct research or perform investigation for the purpose of identifying, abating, or eliminating sources of pollutants or hazards that affect either the environment or the health of the population. Using knowledge of various scientific disciplines, may collect, synthesize, study, report, and recommend action based on data derived from measurements or observations of air, food, soil, water, and other sources.', 'soc_code' => '19-2041.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'environmental-scientist', 'is_active' => '1', 'def_title_id' => '14292', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '262', 'pos_name' => 'Climate Change Analysts', 'pos_description' => 'Research and analyze policy developments related to climate change. Make climate-related recommendations for actions such as legislation, awareness campaigns, or fundraising approaches.', 'soc_code' => '19-2041.01', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '263', 'pos_name' => 'Environmental Restoration Planners', 'pos_description' => 'Collaborate with field and biology staff to oversee the implementation of restoration projects and to develop new products. Process and synthesize complex scientific data into practical strategies for restoration, monitoring or management.', 'soc_code' => '19-2041.02', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '264', 'pos_name' => 'Industrial Ecologists', 'pos_description' => 'Apply principles and processes of natural ecosystems to develop models for efficient industrial systems. Use knowledge from the physical and social sciences to maximize effective use of natural resources in the production and use of goods and services. Examine societal issues and their relationship with both technical systems and the environment.', 'soc_code' => '19-2041.03', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'industrial-ecologist', 'is_active' => '1', 'def_title_id' => '20623', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '265', 'pos_name' => 'Geoscientists, Except Hydrologists and Geographers', 'pos_description' => 'Study the composition, structure, and other physical aspects of the Earth. May use geological, physics, and mathematics knowledge in exploration for oil, gas, minerals, or underground water; or in waste disposal, land reclamation, or other environmental problems. May study the Earth&#039;s internal composition, atmospheres, oceans, and its magnetic, electrical, and gravitational forces. Includes mineralogists, crystallographers, paleontologists, stratigraphers, geodesists, and seismologists.', 'soc_code' => '19-2042.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'geoscientist-earth', 'is_active' => '1', 'def_title_id' => '17631', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '266', 'pos_name' => 'Hydrologists', 'pos_description' => 'Research the distribution, circulation, and physical properties of underground and surface waters; and study the form and intensity of precipitation, its rate of infiltration into the soil, movement through the earth, and its return to the ocean and atmosphere.', 'soc_code' => '19-2043.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => 'hydrologist-research', 'is_active' => '1', 'def_title_id' => '20379', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '267', 'pos_name' => 'Physical Scientists, All Other', 'pos_description' => 'All physical scientists not listed separately.', 'soc_code' => '19-2099.00', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '268', 'pos_name' => 'Remote Sensing Scientists and Technologists', 'pos_description' => 'Apply remote sensing principles and methods to analyze data and solve problems in areas such as natural resource management, urban planning, or homeland security. May develop new sensor systems, analytical techniques, or new applications for existing systems.', 'soc_code' => '19-2099.01', 'major_gid' => '5', 'minor_gid' => '13', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '269', 'pos_name' => 'Economists', 'pos_description' => 'Conduct research, prepare reports, or formulate plans to address economic problems related to the production and distribution of goods and services or monetary and fiscal policy. May collect and process economic and statistical data using sampling techniques and econometric methods.', 'soc_code' => '19-3011.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'economics', 'is_active' => '1', 'def_title_id' => '13142', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '270', 'pos_name' => 'Environmental Economists', 'pos_description' => 'Conduct economic analysis related to environmental protection and use of the natural environment, such as water, air, land, and renewable energy resources. Evaluate and quantify benefits, costs, incentives, and impacts of alternative options using economic principles and statistical techniques.', 'soc_code' => '19-3011.01', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'environmental-economists', 'is_active' => '1', 'def_title_id' => '14228', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '271', 'pos_name' => 'Survey Researchers', 'pos_description' => 'Plan, develop, or conduct surveys. May analyze and interpret the meaning of survey data, determine survey objectives, or suggest or test question wording. Includes social scientists who primarily design questionnaires or supervise survey teams.', 'soc_code' => '19-3022.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'survey-research', 'is_active' => '1', 'def_title_id' => '38554', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '272', 'pos_name' => 'Clinical, Counseling, and School Psychologists', 'pos_description' => 'Diagnose and treat mental disorders; learning disabilities; and cognitive, behavioral, and emotional problems, using individual, child, family, and group therapies. May design and implement behavior modification programs.', 'soc_code' => '19-3031.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '273', 'pos_name' => 'School Psychologists', 'pos_description' => 'Investigate processes of learning and teaching and develop psychological principles and techniques applicable to educational problems.', 'soc_code' => '19-3031.01', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'school-psychology', 'is_active' => '1', 'def_title_id' => '34670', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '274', 'pos_name' => 'Clinical Psychologists', 'pos_description' => 'Diagnose or evaluate mental and emotional disorders of individuals through observation, interview, and psychological tests, and formulate and administer programs of treatment.', 'soc_code' => '19-3031.02', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'clinical-psychologist', 'is_active' => '1', 'def_title_id' => '8074', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '275', 'pos_name' => 'Counseling Psychologists', 'pos_description' => 'Assess and evaluate individuals&#039; problems through the use of case history, interview, and observation and provide individual or group counseling services to assist individuals in achieving more effective personal, social, educational, and vocational development and adjustment.', 'soc_code' => '19-3031.03', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'psychology', 'is_active' => '1', 'def_title_id' => '10096', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '276', 'pos_name' => 'Industrial-Organizational Psychologists', 'pos_description' => 'Apply principles of psychology to human resources, administration, management, sales, and marketing problems. Activities may include policy planning; employee testing and selection, training and development; and organizational development and analysis. May work with management to organize the work setting to improve worker productivity.', 'soc_code' => '19-3032.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'industrial-psychologist', 'is_active' => '1', 'def_title_id' => '20726', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '277', 'pos_name' => 'Psychologists, All Other', 'pos_description' => 'All psychologists not listed separately.', 'soc_code' => '19-3039.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '278', 'pos_name' => 'Neuropsychologists and Clinical Neuropsychologists', 'pos_description' => 'Apply theories and principles of neuropsychology to diagnose and treat disorders of higher cerebral functioning.', 'soc_code' => '19-3039.01', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '279', 'pos_name' => 'Sociologists', 'pos_description' => 'Study human society and social behavior by examining the groups and social institutions that people form, as well as various social, religious, political, and business organizations. May study the behavior and interaction of groups, trace their origin and growth, and analyze the influence of group activities on individual members.', 'soc_code' => '19-3041.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'sociologist', 'is_active' => '0', 'def_title_id' => '36579', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '280', 'pos_name' => 'Urban and Regional Planners', 'pos_description' => 'Develop comprehensive plans and programs for use of land and physical facilities of jurisdictions, such as towns, cities, counties, and metropolitan areas.', 'soc_code' => '19-3051.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'urban-planning', 'is_active' => '1', 'def_title_id' => '41378', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '281', 'pos_name' => 'Anthropologists and Archeologists', 'pos_description' => 'Study the origin, development, and behavior of human beings. May study the way of life, language, or physical characteristics of people in various parts of the world. May engage in systematic recovery and examination of material evidence, such as tools or pottery remaining from past human cultures, in order to determine the history, customs, and living habits of earlier civilizations.', 'soc_code' => '19-3091.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '282', 'pos_name' => 'Anthropologists', 'pos_description' => 'Research, evaluate, and establish public policy concerning the origins of humans; their physical, social, linguistic, and cultural development; and their behavior, as well as the cultures, organizations, and institutions they have created.', 'soc_code' => '19-3091.01', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'anthropologist', 'is_active' => '1', 'def_title_id' => '1348', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '283', 'pos_name' => 'Archeologists', 'pos_description' => 'Conduct research to reconstruct record of past human life and culture from human remains, artifacts, architectural features, and structures recovered through excavation, underwater recovery, or other means of discovery.', 'soc_code' => '19-3091.02', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'archaeology', 'is_active' => '1', 'def_title_id' => '1583', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '284', 'pos_name' => 'Geographers', 'pos_description' => 'Study the nature and use of areas of the Earth\'s surface, relating and interpreting interactions of physical and cultural phenomena. Conduct research on physical aspects of a region, including land forms, climates, soils, plants, and animals, and conduct research on the spatial implications of human activities within a given area, including social characteristics, economic activities, and political organization, as well as researching interdependence between regions at scales ranging from local to global.', 'soc_code' => '19-3092.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '285', 'pos_name' => 'Historians', 'pos_description' => 'Research, analyze, record, and interpret the past as recorded in sources, such as government and institutional records, newspapers and other periodicals, photographs, interviews, films, electronic media, and unpublished manuscripts, such as personal diaries and letters.', 'soc_code' => '19-3093.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '286', 'pos_name' => 'Political Scientists', 'pos_description' => 'Study the origin, development, and operation of political systems. May study topics, such as public opinion, political decision-making, and ideology. May analyze the structure and operation of governments, as well as various political entities. May conduct public opinion surveys, analyze election results, or analyze public documents.', 'soc_code' => '19-3094.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '287', 'pos_name' => 'Social Scientists and Related Workers, All Other', 'pos_description' => 'All social scientists and related workers not listed separately.', 'soc_code' => '19-3099.00', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '288', 'pos_name' => 'Transportation Planners', 'pos_description' => 'Prepare studies for proposed transportation projects. Gather, compile, and analyze data. Study the use and operation of transportation systems. Develop transportation models or simulations.', 'soc_code' => '19-3099.01', 'major_gid' => '5', 'minor_gid' => '14', 'url_desc' => 'transportation-planner', 'is_active' => '0', 'def_title_id' => '40649', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '289', 'pos_name' => 'Agricultural and Food Science Technicians', 'pos_description' => 'Work with agricultural and food scientists in food, fiber, and animal research, production, and processing; and assist with animal breeding and nutrition. Conduct tests and experiments to improve yield and quality of crops or to increase the resistance of plants and animals to disease or insects. Includes technicians who assist food scientists or technologists in the research and development of production technology, quality control, packaging, processing, and use of foods.', 'soc_code' => '19-4011.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '290', 'pos_name' => 'Agricultural Technicians', 'pos_description' => 'Set up or maintain laboratory equipment and collect samples from crops or animals. Prepare specimens or record data to assist scientists in biology or related life science experiments.', 'soc_code' => '19-4011.01', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'agriculture', 'is_active' => '1', 'def_title_id' => '678', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '291', 'pos_name' => 'Food Science Technicians', 'pos_description' => 'Perform standardized qualitative and quantitative tests to determine physical or chemical properties of food or beverage products.', 'soc_code' => '19-4011.02', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'food-technology', 'is_active' => '1', 'def_title_id' => '16281', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '292', 'pos_name' => 'Biological Technicians', 'pos_description' => 'Assist biological and medical scientists in laboratories. Set up, operate, and maintain laboratory instruments and equipment, monitor experiments, make observations, and calculate and record results. May analyze organic substances, such as blood, food, and drugs.', 'soc_code' => '19-4021.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'biological-tech', 'is_active' => '1', 'def_title_id' => '3753', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '293', 'pos_name' => 'Chemical Technicians', 'pos_description' => 'Conduct chemical and physical laboratory tests to assist scientists in making qualitative and quantitative analyses of solids, liquids, and gaseous materials for research and development of new products or processes, quality control, maintenance of environmental standards, and other work involving experimental, theoretical, or practical application of chemistry and related sciences.', 'soc_code' => '19-4031.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'chemical-tech', 'is_active' => '1', 'def_title_id' => '7184', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '294', 'pos_name' => 'Geological and Petroleum Technicians', 'pos_description' => 'Assist scientists or engineers in the use of electronic, sonic, or nuclear measuring instruments in both laboratory and production activities to obtain data indicating potential resources such as metallic ore, minerals, gas, coal, or petroleum. Analyze mud and drill cuttings. Chart pressure, temperature, and other characteristics of wells or bore holes. Investigate and collect information leading to the possible discovery of new metallic ore, minerals, gas, coal, or petroleum deposits.', 'soc_code' => '19-4041.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '295', 'pos_name' => 'Geophysical Data Technicians', 'pos_description' => 'Measure, record, or evaluate geological data, using sonic, electronic, electrical, seismic, or gravity-measuring instruments to prospect for oil or gas. May collect or evaluate core samples or cuttings.', 'soc_code' => '19-4041.01', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'geophysical-technician', 'is_active' => '1', 'def_title_id' => '17612', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '296', 'pos_name' => 'Geological Sample Test Technicians', 'pos_description' => 'Test or analyze geological samples, crude oil, or minerals to detect presence of petroleum, gas, or mineral deposits indicating potential for exploration or production or to determine physical or chemical properties to ensure that products meet quality standards.', 'soc_code' => '19-4041.02', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'geological-technician', 'is_active' => '1', 'def_title_id' => '17590', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '297', 'pos_name' => 'Nuclear Technicians', 'pos_description' => 'Assist nuclear physicists, nuclear engineers, or other scientists in laboratory or production activities. May operate, maintain, or provide quality control for nuclear testing and research equipment. May monitor radiation.', 'soc_code' => '19-4051.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '298', 'pos_name' => 'Nuclear Equipment Operation Technicians', 'pos_description' => 'Operate equipment used for the release, control, or utilization of nuclear energy to assist scientists in laboratory or production activities.', 'soc_code' => '19-4051.01', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '299', 'pos_name' => 'Nuclear Monitoring Technicians', 'pos_description' => 'Collect and test samples to monitor results of nuclear experiments and contamination of humans, facilities, and environment.', 'soc_code' => '19-4051.02', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '300', 'pos_name' => 'Social Science Research Assistants', 'pos_description' => 'Assist social scientists in laboratory, survey, and other social science research. May help prepare findings for publication and assist in laboratory analysis, quality control, or data management.', 'soc_code' => '19-4061.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '301', 'pos_name' => 'City and Regional Planning Aides', 'pos_description' => 'Compile data from various sources, such as maps, reports, and field and file investigations, for use by city planner in making planning studies.', 'soc_code' => '19-4061.01', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '302', 'pos_name' => 'Environmental Science and Protection Technicians, Including Health', 'pos_description' => 'Perform laboratory and field tests to monitor the environment and investigate sources of pollution, including those that affect health, under the direction of an environmental scientist, engineer, or other specialist. May collect samples of gases, soil, water, and other materials for testing.', 'soc_code' => '19-4091.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '303', 'pos_name' => 'Forensic Science Technicians', 'pos_description' => 'Collect, identify, classify, and analyze physical evidence related to criminal investigations. Perform tests on weapons or substances, such as fiber, hair, and tissue to determine significance to investigation. May testify as expert witnesses on evidence or crime laboratory techniques. May serve as specialists in area of expertise, such as ballistics, fingerprinting, handwriting, or biochemistry.', 'soc_code' => '19-4092.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '304', 'pos_name' => 'Forest and Conservation Technicians', 'pos_description' => 'Provide technical assistance regarding the conservation of soil, water, forests, or related natural resources. May compile data pertaining to size, content, condition, and other characteristics of forest tracts, under the direction of foresters; or train and lead forest workers in forest propagation, fire prevention and suppression. May assist conservation scientists in managing, improving, and protecting rangelands and wildlife habitats.', 'soc_code' => '19-4093.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '305', 'pos_name' => 'Life, Physical, and Social Science Technicians, All Other', 'pos_description' => 'All life, physical, and social science technicians not listed separately.', 'soc_code' => '19-4099.00', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '306', 'pos_name' => 'Quality Control Analysts', 'pos_description' => 'Conduct tests to determine quality of raw materials, bulk intermediate and finished products. May conduct stability sample tests.', 'soc_code' => '19-4099.01', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'qc-analyst', 'is_active' => '1', 'def_title_id' => '31948', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '307', 'pos_name' => 'Precision Agriculture Technicians', 'pos_description' => 'Apply geospatial technologies, including geographic information systems (GIS) and Global Positioning System (GPS), to agricultural production or management activities, such as pest scouting, site-specific pesticide application, yield mapping, or variable-rate irrigation. May use computers to develop or analyze maps or remote sensing images to compare physical topography with data on soils, fertilizer, pests, or weather.', 'soc_code' => '19-4099.02', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'precision-agriculture', 'is_active' => '1', 'def_title_id' => '30630', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '308', 'pos_name' => 'Remote Sensing Technicians', 'pos_description' => 'Apply remote sensing technologies to assist scientists in areas such as natural resources, urban planning, or homeland security. May prepare flight plans or sensor configurations for flight trips.', 'soc_code' => '19-4099.03', 'major_gid' => '5', 'minor_gid' => '15', 'url_desc' => 'sensing-technician', 'is_active' => '0', 'def_title_id' => '33043', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '309', 'pos_name' => 'Substance Abuse and Behavioral Disorder Counselors', 'pos_description' => 'Counsel and advise individuals with alcohol, tobacco, drug, or other problems, such as gambling and eating disorders. May counsel individuals, families, or groups or engage in prevention programs.', 'soc_code' => '21-1011.00', 'major_gid' => '6', 'minor_gid' => '16', 'url_desc' => 'substance-counselor', 'is_active' => '0', 'def_title_id' => '38315', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '310', 'pos_name' => 'Educational, Guidance, School, and Vocational Counselors', 'pos_description' => 'Counsel individuals and provide group educational and vocational guidance services.', 'soc_code' => '21-1012.00', 'major_gid' => '6', 'minor_gid' => '16', 'url_desc' => 'academic', 'is_active' => '1', 'def_title_id' => '72', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '311', 'pos_name' => 'Marriage and Family Therapists', 'pos_description' => 'Diagnose and treat mental and emotional disorders, whether cognitive, affective, or behavioral, within the context of marriage and family systems. Apply psychotherapeutic and family systems theories and techniques in the delivery of services to individuals, couples, and families for the purpose of treating such diagnosed nervous and mental disorders.', 'soc_code' => '21-1013.00', 'major_gid' => '6', 'minor_gid' => '16', 'url_desc' => 'marriage-therapist', 'is_active' => '1', 'def_title_id' => '24506', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '312', 'pos_name' => 'Mental Health Counselors', 'pos_description' => 'Counsel with emphasis on prevention. Work with individuals and groups to promote optimum mental and emotional health. May help individuals deal with issues associated with addictions and substance abuse; family, parenting, and marital problems; stress management; self-esteem; and aging.', 'soc_code' => '21-1014.00', 'major_gid' => '6', 'minor_gid' => '16', 'url_desc' => 'mental-counselor', 'is_active' => '1', 'def_title_id' => '25169', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '313', 'pos_name' => 'Rehabilitation Counselors', 'pos_description' => 'Counsel individuals to maximize the independence and employability of persons coping with personal, social, and vocational difficulties that result from birth defects, illness, disease, accidents, or the stress of daily life. Coordinate activities for residents of care and treatment facilities. Assess client needs and design and implement rehabilitation programs that may include personal and vocational counseling, training, and job placement.', 'soc_code' => '21-1015.00', 'major_gid' => '6', 'minor_gid' => '16', 'url_desc' => 'rehab-counselor', 'is_active' => '0', 'def_title_id' => '32931', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '314', 'pos_name' => 'Counselors, All Other', 'pos_description' => 'All counselors not listed separately.', 'soc_code' => '21-1019.00', 'major_gid' => '6', 'minor_gid' => '16', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '315', 'pos_name' => 'Child, Family, and School Social Workers', 'pos_description' => 'Provide social services and assistance to improve the social and psychological functioning of children and their families and to maximize the family well-being and the academic functioning of children. May assist parents, arrange adoptions, and find foster homes for abandoned or abused children. In schools, they address such problems as teenage pregnancy, misbehavior, and truancy. May also advise teachers.', 'soc_code' => '21-1021.00', 'major_gid' => '6', 'minor_gid' => '16', 'url_desc' => 'social-work', 'is_active' => '1', 'def_title_id' => '6321', 'created_at' => NULL, 'updated_at' => NULL),
