            array('id' => '479', 'pos_name' => 'Preventive Medicine Physicians', 'pos_description' => 'Apply knowledge of general preventive medicine and public health issues to promote health care to groups or individuals, and aid in the prevention or reduction of risk of disease, injury, disability, or death. May practice population-based medicine or diagnose and treat patients in the context of clinical health promotion and disease prevention.', 'soc_code' => '29-1069.09', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
