            array('id' => '483', 'pos_name' => 'Physician Assistants', 'pos_description' => 'Provide healthcare services typically performed by a physician, under the supervision of a physician. Conduct complete physicals, provide treatment, and counsel patients. May, in some cases, prescribe medication. Must graduate from an accredited educational program for physician assistants.', 'soc_code' => '29-1071.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
