            array('id' => '486', 'pos_name' => 'Occupational Therapists', 'pos_description' => 'Assess, plan, organize, and participate in rehabilitative programs that help build or restore vocational, homemaking, and daily living skills, as well as general independence, to persons with disabilities or developmental delays.', 'soc_code' => '29-1122.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'ot', 'is_active' => '1', 'def_title_id' => '27255', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '487', 'pos_name' => 'Low Vision Therapists, Orientation and Mobility Specialists, and Vision Rehabilitation Therapists', 'pos_description' => 'Provide therapy to patients with visual impairments to improve their functioning in daily life activities. May train patients in activities such as computer use, communication skills, or home management skills.', 'soc_code' => '29-1122.01', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'low-vision-therapist', 'is_active' => '1', 'def_title_id' => '41859', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '488', 'pos_name' => 'Physical Therapists', 'pos_description' => 'Assess, plan, organize, and participate in rehabilitative programs that improve mobility, relieve pain, increase strength, and improve or correct disabling conditions resulting from disease or injury.', 'soc_code' => '29-1123.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'pt', 'is_active' => '1', 'def_title_id' => '29365', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '489', 'pos_name' => 'Radiation Therapists', 'pos_description' => 'Provide radiation therapy to patients as prescribed by a radiologist according to established practices and standards. Duties may include reviewing prescription and diagnosis; acting as liaison with physician and supportive care personnel; preparing equipment, such as immobilization, treatment, and protection devices; and maintaining records, reports, and files. May assist in dosimetry procedures and tumor localization.', 'soc_code' => '29-1124.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '490', 'pos_name' => 'Recreational Therapists', 'pos_description' => 'Plan, direct, or coordinate medically-approved recreation programs for patients in hospitals, nursing homes, or other institutions. Activities include sports, trips, dramatics, social activities, and arts and crafts. May assess a patient condition and recommend appropriate recreational activity.', 'soc_code' => '29-1125.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'recreational-therapist', 'is_active' => '0', 'def_title_id' => '32667', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '491', 'pos_name' => 'Art Therapists', 'pos_description' => 'Plan or conduct art therapy sessions or programs to improve clients\' physical, cognitive, or emotional well-being.', 'soc_code' => '29-1125.01', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '492', 'pos_name' => 'Music Therapists', 'pos_description' => 'Plan, organize, or direct medically prescribed music therapy activities designed to positively influence patients\' psychological or behavioral status.', 'soc_code' => '29-1125.02', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '493', 'pos_name' => 'Respiratory Therapists', 'pos_description' => 'Assess, treat, and care for patients with breathing disorders. Assume primary responsibility for all respiratory care modalities, including the supervision of respiratory therapy technicians. Initiate and conduct therapeutic procedures; maintain patient records; and select, assemble, check, and operate equipment.', 'soc_code' => '29-1126.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'rt', 'is_active' => '1', 'def_title_id' => '33337', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '494', 'pos_name' => 'Speech-Language Pathologists', 'pos_description' => 'Assess and treat persons with speech, language, voice, and fluency disorders. May select alternative communication systems and teach their use. May perform research related to speech and language problems.', 'soc_code' => '29-1127.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'slp', 'is_active' => '1', 'def_title_id' => '37061', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '495', 'pos_name' => 'Exercise Physiologists', 'pos_description' => 'Assess, plan, or implement fitness programs that include exercise or physical activities such as those designed to improve cardiorespiratory function, body composition, muscular strength, muscular endurance, or flexibility.', 'soc_code' => '29-1128.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'exercise', 'is_active' => '1', 'def_title_id' => '14521', 'created_at' => NULL, 'updated_at' => NULL),
