            array('id' => '497', 'pos_name' => 'Veterinarians', 'pos_description' => 'Diagnose, treat, or research diseases and injuries of animals. Includes veterinarians who conduct research and development, inspect livestock, or care for pets and companion animals.', 'soc_code' => '29-1131.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'animal-vet', 'is_active' => '0', 'def_title_id' => '41725', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '498', 'pos_name' => 'Registered Nurses', 'pos_description' => 'Assess patient health problems and needs, develop and implement nursing care plans, and maintain medical records. Administer nursing care to ill, injured, convalescent, or disabled patients. May advise patients on health maintenance and disease prevention or provide case management. Licensing or registration required.', 'soc_code' => '29-1141.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'nurse', 'is_active' => '1', 'def_title_id' => '32869', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '499', 'pos_name' => 'Acute Care Nurses', 'pos_description' => 'Provide advanced nursing care for patients with acute conditions such as heart attacks, respiratory distress syndrome, or shock. May care for pre- and post-operative patients or perform advanced, invasive diagnostic or therapeutic procedures.', 'soc_code' => '29-1141.01', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'acute-care', 'is_active' => '1', 'def_title_id' => '284', 'created_at' => NULL, 'updated_at' => NULL),
