            array('id' => '501', 'pos_name' => 'Critical Care Nurses', 'pos_description' => 'Provide advanced nursing care for patients in critical or coronary care units.', 'soc_code' => '29-1141.03', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'critical-care-nursing', 'is_active' => '1', 'def_title_id' => '10456', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '502', 'pos_name' => 'Clinical Nurse Specialists', 'pos_description' => 'Plan, direct, or coordinate the daily patient care activities in a clinical practice. Ensure adherence to established clinical policies, protocols, regulations, and standards.', 'soc_code' => '29-1141.04', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'nurse-specialist', 'is_active' => '1', 'def_title_id' => '8057', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '503', 'pos_name' => 'Nurse Anesthetists', 'pos_description' => 'Administer anesthesia, monitor patient&#039;s vital signs, and oversee patient recovery from anesthesia. May assist anesthesiologists, surgeons, other physicians, or dentists. Must be registered nurses who have specialized graduate education.', 'soc_code' => '29-1151.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'nurse-anesthetist', 'is_active' => '1', 'def_title_id' => '27093', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '504', 'pos_name' => 'Nurse Midwives', 'pos_description' => 'Diagnose and coordinate all aspects of the birthing process, either independently or as part of a healthcare team. May provide well-woman gynecological care. Must have specialized, graduate nursing education.', 'soc_code' => '29-1161.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'nurse-midwife', 'is_active' => '1', 'def_title_id' => '27105', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '505', 'pos_name' => 'Nurse Practitioners', 'pos_description' => 'Diagnose and treat acute, episodic, or chronic illness, independently or as part of a healthcare team. May focus on health promotion and disease prevention. May order, perform, or interpret diagnostic tests such as lab work and x rays. May prescribe medication. Must be registered nurses who have specialized graduate education.', 'soc_code' => '29-1171.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '506', 'pos_name' => 'Audiologists', 'pos_description' => 'Assess and treat persons with hearing and related disorders. May fit hearing aids and provide auditory training. May perform research related to hearing problems.', 'soc_code' => '29-1181.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => 'audiologist', 'is_active' => '1', 'def_title_id' => '2209', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '507', 'pos_name' => 'Health Diagnosing and Treating Practitioners, All Other', 'pos_description' => 'All health diagnosing and treating practitioners not listed separately.', 'soc_code' => '29-1199.00', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '508', 'pos_name' => 'Acupuncturists', 'pos_description' => 'Provide treatment of symptoms and disorders using needles and small electrical currents. May provide massage treatment. May also provide preventive treatments.', 'soc_code' => '29-1199.01', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '509', 'pos_name' => 'Naturopathic Physicians', 'pos_description' => 'Diagnose, treat, and help prevent diseases using a system of practice that is based on the natural healing capacity of individuals. May use physiological, psychological or mechanical methods. May also use natural medicines, prescription or legend drugs, foods, herbs, or other natural remedies.', 'soc_code' => '29-1199.04', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '510', 'pos_name' => 'Orthoptists', 'pos_description' => 'Diagnose and treat visual system disorders such as binocular vision and eye movement impairments.', 'soc_code' => '29-1199.05', 'major_gid' => '10', 'minor_gid' => '29', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
