            array('id' => '512', 'pos_name' => 'Cytogenetic Technologists', 'pos_description' => 'Analyze chromosomes found in biological specimens such as amniotic fluids, bone marrow, and blood to aid in the study, diagnosis, or treatment of genetic diseases.', 'soc_code' => '29-2011.01', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'cytogenetic-tech', 'is_active' => '1', 'def_title_id' => '10925', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '513', 'pos_name' => 'Cytotechnologists', 'pos_description' => 'Stain, mount, and study cells to detect evidence of cancer, hormonal abnormalities, and other pathological conditions following established standards and practices.', 'soc_code' => '29-2011.02', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'cytotechnologist', 'is_active' => '1', 'def_title_id' => '10933', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '514', 'pos_name' => 'Histotechnologists and Histologic Technicians', 'pos_description' => 'Prepare histologic slides from tissue sections for microscopic examination and diagnosis by pathologists. May assist in research studies.', 'soc_code' => '29-2011.03', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'histologic-tech', 'is_active' => '1', 'def_title_id' => '19575', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '515', 'pos_name' => 'Medical and Clinical Laboratory Technicians', 'pos_description' => 'Perform routine medical laboratory tests for the diagnosis, treatment, and prevention of disease. May work under the supervision of a medical technologist.', 'soc_code' => '29-2012.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'medical-tech', 'is_active' => '1', 'def_title_id' => '22124', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '516', 'pos_name' => 'Dental Hygienists', 'pos_description' => 'Clean teeth and examine oral areas, head, and neck for signs of oral disease. May educate patients on oral hygiene, take and develop x rays, or apply fluoride or sealants.', 'soc_code' => '29-2021.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'dental-hygiene', 'is_active' => '1', 'def_title_id' => '11335', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '517', 'pos_name' => 'Cardiovascular Technologists and Technicians', 'pos_description' => 'Conduct tests on pulmonary or cardiovascular systems of patients for diagnostic purposes. May conduct or assist in electrocardiograms, cardiac catheterizations, pulmonary functions, lung capacity, and similar tests. Includes vascular technologists.', 'soc_code' => '29-2031.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'cardiovascular-technologist', 'is_active' => '1', 'def_title_id' => '6137', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '518', 'pos_name' => 'Diagnostic Medical Sonographers', 'pos_description' => 'Produce ultrasonic recordings of internal organs for use by physicians.', 'soc_code' => '29-2032.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'diagnostic-sonographer', 'is_active' => '1', 'def_title_id' => '11560', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '519', 'pos_name' => 'Nuclear Medicine Technologists', 'pos_description' => 'Prepare, administer, and measure radioactive isotopes in therapeutic, diagnostic, and tracer studies using a variety of radioisotope equipment. Prepare stock solutions of radioactive materials and calculate doses to be administered by radiologists. Subject patients to radiation. Execute blood volume, red cell survival, and fat absorption studies following standard laboratory techniques.', 'soc_code' => '29-2033.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '520', 'pos_name' => 'Radiologic Technologists', 'pos_description' => 'Take x rays and CAT scans or administer nonradioactive materials into patient&#039;s blood stream for diagnostic purposes. Includes technologists who specialize in other scanning modalities.', 'soc_code' => '29-2034.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'radiologic-technologist', 'is_active' => '1', 'def_title_id' => '32220', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '521', 'pos_name' => 'Magnetic Resonance Imaging Technologists', 'pos_description' => 'Operate Magnetic Resonance Imaging (MRI) scanners. Monitor patient safety and comfort, and view images of area being scanned to ensure quality of pictures. May administer gadolinium contrast dosage intravenously. May interview patient, explain MRI procedures, and position patient on examining table. May enter into the computer data such as patient history, anatomical area to be scanned, orientation specified, and position of entry.', 'soc_code' => '29-2035.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'mri', 'is_active' => '1', 'def_title_id' => '26310', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '522', 'pos_name' => 'Emergency Medical Technicians and Paramedics', 'pos_description' => 'Assess injuries, administer emergency medical care, and extricate trapped individuals. Transport injured or sick persons to medical facilities.', 'soc_code' => '29-2041.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'emergency-medical', 'is_active' => '1', 'def_title_id' => '28411', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '523', 'pos_name' => 'Dietetic Technicians', 'pos_description' => 'Assist in the provision of food service and nutritional programs, under the supervision of a dietitian. May plan and produce meals based on established guidelines, teach principles of food and nutrition, or counsel individuals.', 'soc_code' => '29-2051.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'dietary-support', 'is_active' => '1', 'def_title_id' => '11758', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '524', 'pos_name' => 'Pharmacy Technicians', 'pos_description' => 'Prepare medications under the direction of a pharmacist. May measure, mix, count out, label, and record amounts and dosages of medications according to prescription orders.', 'soc_code' => '29-2052.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'pharmacy-tech', 'is_active' => '1', 'def_title_id' => '29163', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '525', 'pos_name' => 'Psychiatric Technicians', 'pos_description' => 'Care for individuals with mental or emotional conditions or disabilities, following the instructions of physicians or other health practitioners. Monitor patients&#039; physical and emotional well-being and report to medical staff. May participate in rehabilitation and treatment programs, help with personal hygiene, and administer oral or injectable medications.', 'soc_code' => '29-2053.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'psych-tech', 'is_active' => '1', 'def_title_id' => '31577', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '526', 'pos_name' => 'Respiratory Therapy Technicians', 'pos_description' => 'Provide respiratory care under the direction of respiratory therapists and physicians.', 'soc_code' => '29-2054.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'rt-technician', 'is_active' => '1', 'def_title_id' => '33341', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '527', 'pos_name' => 'Surgical Technologists', 'pos_description' => 'Assist in operations, under the supervision of surgeons, registered nurses, or other surgical personnel. May help set up operating room, prepare and transport patients for surgery, adjust lights and equipment, pass instruments and other supplies to surgeons and surgeon&#039;s assistants, hold retractors, cut sutures, and help count sponges, needles, supplies, and instruments.', 'soc_code' => '29-2055.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'surgical-tech', 'is_active' => '1', 'def_title_id' => '6906', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '528', 'pos_name' => 'Veterinary Technologists and Technicians', 'pos_description' => 'Perform medical tests in a laboratory environment for use in the treatment and diagnosis of diseases in animals. Prepare vaccines and serums for prevention of diseases. Prepare tissue samples, take blood samples, and execute laboratory tests, such as urinalysis and blood counts. Clean and sterilize instruments and materials and maintain equipment and machines. May assist a veterinarian during surgery.', 'soc_code' => '29-2056.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'vet-tech', 'is_active' => '1', 'def_title_id' => '41765', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '529', 'pos_name' => 'Ophthalmic Medical Technicians', 'pos_description' => 'Assist ophthalmologists by performing ophthalmic clinical functions. May administer eye exams, administer eye medications, and instruct the patient in care and use of corrective lenses.', 'soc_code' => '29-2057.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'ophthalmic-tech', 'is_active' => '1', 'def_title_id' => '27639', 'created_at' => NULL, 'updated_at' => NULL),
