            array('id' => '531', 'pos_name' => 'Medical Records and Health Information Technicians', 'pos_description' => 'Compile, process, and maintain medical records of hospital and clinic patients in a manner consistent with medical, administrative, ethical, legal, and regulatory requirements of the health care system. Process, maintain, compile, and report patient information for health requirements and standards in a manner consistent with the healthcare industry&#039;s numerical coding system.', 'soc_code' => '29-2071.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'medical-records', 'is_active' => '1', 'def_title_id' => '25058', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '532', 'pos_name' => 'Opticians, Dispensing', 'pos_description' => 'Design, measure, fit, and adapt lenses and frames for client according to written optical prescription or specification. Assist client with inserting, removing, and caring for contact lenses. Assist client with selecting frames. Measure customer for size of eyeglasses and coordinate frames with facial and eye measurements and optical prescription. Prepare work order for optical laboratory containing instructions for grinding and mounting lenses in frames. Verify exactness of finished lens spectacles. Adjust frame and lens position to fit client. May shape or reshape frames. Includes contact lens opticians.', 'soc_code' => '29-2081.00', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'optician', 'is_active' => '1', 'def_title_id' => '27684', 'created_at' => NULL, 'updated_at' => NULL),
