            array('id' => '536', 'pos_name' => 'Neurodiagnostic Technologists', 'pos_description' => 'Conduct electroneurodiagnostic (END) tests such as electroencephalograms, evoked potentials, polysomnograms, or electronystagmograms. May perform nerve conduction studies.', 'soc_code' => '29-2099.01', 'major_gid' => '10', 'minor_gid' => '30', 'url_desc' => 'neurodiagnostic-technologist', 'is_active' => '1', 'def_title_id' => '26796', 'created_at' => NULL, 'updated_at' => NULL),
