            array('id' => '540', 'pos_name' => 'Occupational Health and Safety Specialists', 'pos_description' => 'Review, evaluate, and analyze work environments and design programs and procedures to control, eliminate, and prevent disease or injury caused by chemical, physical, and biological agents or ergonomic factors. May conduct inspections and enforce adherence to laws and regulations governing the health and safety of individuals. May be employed in the public or private sector. Includes environmental protection officers.', 'soc_code' => '29-9011.00', 'major_gid' => '10', 'minor_gid' => '31', 'url_desc' => 'occupational-safety', 'is_active' => '1', 'def_title_id' => '27239', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '541', 'pos_name' => 'Occupational Health and Safety Technicians', 'pos_description' => 'Collect data on work environments for analysis by occupational health and safety specialists. Implement and conduct evaluation of programs designed to limit chemical, physical, biological, and ergonomic risks to workers.', 'soc_code' => '29-9012.00', 'major_gid' => '10', 'minor_gid' => '31', 'url_desc' => 'occupational-technician', 'is_active' => '1', 'def_title_id' => '19129', 'created_at' => NULL, 'updated_at' => NULL),
