            array('id' => '546', 'pos_name' => 'Home Health Aides', 'pos_description' => 'Provide routine individualized healthcare such as changing bandages and dressing wounds, and applying topical medications to the elderly, convalescents, or persons with disabilities at the patient&#039;s home or in a care facility. Monitor or report changes in health status. May also provide personal care such as bathing, dressing, and grooming of patient.', 'soc_code' => '31-1011.00', 'major_gid' => '11', 'minor_gid' => '32', 'url_desc' => 'home-health-aide', 'is_active' => '1', 'def_title_id' => '19704', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '547', 'pos_name' => 'Psychiatric Aides', 'pos_description' => 'Assist mentally impaired or emotionally disturbed patients, working under direction of nursing and medical staff. May assist with daily living activities, lead patients in educational and recreational activities, or accompany patients to and from examinations and treatments. May restrain violent patients. Includes psychiatric orderlies.', 'soc_code' => '31-1013.00', 'major_gid' => '11', 'minor_gid' => '32', 'url_desc' => 'psych-aide', 'is_active' => '1', 'def_title_id' => '31560', 'created_at' => NULL, 'updated_at' => NULL),
