            array('id' => '549', 'pos_name' => 'Orderlies', 'pos_description' => 'Transport patients to areas such as operating rooms or x-ray rooms using wheelchairs, stretchers, or moveable beds. May maintain stocks of supplies or clean and transport equipment.', 'soc_code' => '31-1015.00', 'major_gid' => '11', 'minor_gid' => '32', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '550', 'pos_name' => 'Occupational Therapy Assistants', 'pos_description' => 'Assist occupational therapists in providing occupational therapy treatments and procedures. May, in accordance with State laws, assist in development of treatment plans, carry out routine functions, direct activity programs, and document the progress of treatments. Generally requires formal training.', 'soc_code' => '31-2011.00', 'major_gid' => '11', 'minor_gid' => '33', 'url_desc' => 'ot-assistant', 'is_active' => '1', 'def_title_id' => '27263', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '551', 'pos_name' => 'Occupational Therapy Aides', 'pos_description' => 'Under close supervision of an occupational therapist or occupational therapy assistant, perform only delegated, selected, or routine tasks in specific situations. These duties include preparing patient and treatment room.', 'soc_code' => '31-2012.00', 'major_gid' => '11', 'minor_gid' => '33', 'url_desc' => 'ot-aide', 'is_active' => '1', 'def_title_id' => '27260', 'created_at' => NULL, 'updated_at' => NULL),
