            array('id' => '556', 'pos_name' => 'Medical Assistants', 'pos_description' => 'Perform administrative and certain clinical duties under the direction of a physician. Administrative duties may include scheduling appointments, maintaining medical records, billing, and coding information for insurance purposes. Clinical duties may include taking and recording vital signs and medical histories, preparing patients for examination, drawing blood, and administering medications as directed by physician.', 'soc_code' => '31-9092.00', 'major_gid' => '11', 'minor_gid' => '34', 'url_desc' => 'medical-assistance', 'is_active' => '1', 'def_title_id' => '6743', 'created_at' => NULL, 'updated_at' => NULL),
