            array('id' => '626', 'pos_name' => 'Landscaping and Groundskeeping Workers', 'pos_description' => 'Landscape or maintain grounds of property using hand or power tools or equipment. Workers typically perform a variety of tasks, which may include any combination of the following: sod laying, mowing, trimming, planting, watering, fertilizing, digging, raking, sprinkler installation, and installation of mortarless segmental concrete masonry wall units.', 'soc_code' => '37-3011.00', 'major_gid' => '14', 'minor_gid' => '45', 'url_desc' => 'landscaping-worker', 'is_active' => '1', 'def_title_id' => '22297', 'created_at' => NULL, 'updated_at' => NULL),
