            array('id' => '628', 'pos_name' => 'Tree Trimmers and Pruners', 'pos_description' => 'Using sophisticated climbing and rigging techniques, cut away dead or excess branches from trees or shrubs to maintain right-of-way for roads, sidewalks, or utilities, or to improve appearance, health, and value of tree. Prune or treat trees or shrubs using handsaws, hand pruners, clippers, and power pruners. Works off the ground in the tree canopy and may use truck-mounted lifts.', 'soc_code' => '37-3013.00', 'major_gid' => '14', 'minor_gid' => '45', 'url_desc' => 'trimming', 'is_active' => '1', 'def_title_id' => '40780', 'created_at' => NULL, 'updated_at' => NULL),
