            array('id' => '693', 'pos_name' => 'Switchboard Operators, Including Answering Service', 'pos_description' => 'Operate telephone business systems equipment or switchboards to relay incoming, outgoing, and interoffice calls. May supply information to callers and record messages.', 'soc_code' => '43-2011.00', 'major_gid' => '17', 'minor_gid' => '60', 'url_desc' => 'switchboard', 'is_active' => '1', 'def_title_id' => '27634', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '694', 'pos_name' => 'Telephone Operators', 'pos_description' => 'Provide information by accessing alphabetical, geographical, or other directories. Assist customers with special billing requests, such as charges to a third party and credits or refunds for incorrectly dialed numbers or bad connections. May handle emergency calls and assist children or people with physical disabilities to make telephone calls.', 'soc_code' => '43-2021.00', 'major_gid' => '17', 'minor_gid' => '60', 'url_desc' => 'phone', 'is_active' => '1', 'def_title_id' => '27634', 'created_at' => NULL, 'updated_at' => NULL),
