            array('id' => '696', 'pos_name' => 'Bill and Account Collectors', 'pos_description' => 'Locate and notify customers of delinquent accounts by mail, telephone, or personal visit to solicit payment. Duties include receiving payment and posting amount to customer&#039;s account; preparing statements to credit department if customer fails to respond; initiating repossession proceedings or service disconnection; and keeping records of collection and status of accounts.', 'soc_code' => '43-3011.00', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => 'bill-collections', 'is_active' => '1', 'def_title_id' => '8521', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '697', 'pos_name' => 'Billing and Posting Clerks', 'pos_description' => 'Compile, compute, and record billing, accounting, statistical, and other numerical data for billing purposes. Prepare billing invoices for services rendered or for delivery or shipment of goods.', 'soc_code' => '43-3021.00', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '698', 'pos_name' => 'Statement Clerks', 'pos_description' => 'Prepare and distribute bank statements to customers, answer inquiries, and reconcile discrepancies in records and accounts.', 'soc_code' => '43-3021.01', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => 'statements', 'is_active' => '1', 'def_title_id' => '37528', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '699', 'pos_name' => 'Billing, Cost, and Rate Clerks', 'pos_description' => 'Compile data, compute fees and charges, and prepare invoices for billing purposes. Duties include computing costs and calculating rates for goods, services, and shipment of goods; posting data; and keeping other relevant records. May involve use of computer or typewriter, calculator, and adding and bookkeeping machines.', 'soc_code' => '43-3021.02', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => 'billing', 'is_active' => '1', 'def_title_id' => '3611', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '700', 'pos_name' => 'Bookkeeping, Accounting, and Auditing Clerks', 'pos_description' => 'Compute, classify, and record numerical data to keep financial records complete. Perform any combination of routine calculating, posting, and verifying duties to obtain primary financial data for use in maintaining accounting records. May also check the accuracy of figures, calculations, and postings pertaining to business transactions recorded by other workers.', 'soc_code' => '43-3031.00', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => 'accounting', 'is_active' => '1', 'def_title_id' => '127', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '701', 'pos_name' => 'Gaming Cage Workers', 'pos_description' => 'In a gaming establishment, conduct financial transactions for patrons. May reconcile daily summaries of transactions to balance books. May accept patron&#039;s credit application and verify credit references to provide check-cashing authorization or to establish house credit accounts. May sell gambling chips, tokens, or tickets to patrons, or to other workers for resale to patrons. May convert gaming chips, tokens, or tickets to currency upon patron&#039;s request. May use a cash register or computer to record transaction.', 'soc_code' => '43-3041.00', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => 'gaming-cage', 'is_active' => '1', 'def_title_id' => '17134', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '702', 'pos_name' => 'Payroll and Timekeeping Clerks', 'pos_description' => 'Compile and record employee time and payroll data. May compute employees&#039; time worked, production, and commission. May compute and post wages and deductions, or prepare paychecks.', 'soc_code' => '43-3051.00', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => 'payroll', 'is_active' => '1', 'def_title_id' => '28780', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '703', 'pos_name' => 'Procurement Clerks', 'pos_description' => 'Compile information and records to draw up purchase orders for procurement of materials and services.', 'soc_code' => '43-3061.00', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => 'procurement', 'is_active' => '1', 'def_title_id' => '5463', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '704', 'pos_name' => 'Tellers', 'pos_description' => 'Receive and pay out money. Keep records of money and negotiable instruments involved in a financial institution&#039;s various transactions.', 'soc_code' => '43-3071.00', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => 'cash', 'is_active' => '1', 'def_title_id' => '39375', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '705', 'pos_name' => 'Financial Clerks, All Other', 'pos_description' => 'All financial clerks not listed separately.', 'soc_code' => '43-3099.00', 'major_gid' => '17', 'minor_gid' => '61', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '706', 'pos_name' => 'Brokerage Clerks', 'pos_description' => 'Perform duties related to the purchase, sale or holding of securities. Duties include writing orders for stock purchases or sales, computing transfer taxes, verifying stock transactions, accepting and delivering securities, tracking stock price fluctuations, computing equity, distributing dividends, and keeping records of daily transactions and holdings.', 'soc_code' => '43-4011.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'brokerage-clerk', 'is_active' => '1', 'def_title_id' => '4940', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '707', 'pos_name' => 'Correspondence Clerks', 'pos_description' => 'Compose letters or electronic correspondence in reply to requests for merchandise, damage claims, credit and other information, delinquent accounts, incorrect billings, or unsatisfactory services. Duties may include gathering data to formulate reply and preparing correspondence.', 'soc_code' => '43-4021.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'correspondence', 'is_active' => '1', 'def_title_id' => '9968', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '708', 'pos_name' => 'Court, Municipal, and License Clerks', 'pos_description' => 'Perform clerical duties for courts of law, municipalities, or governmental licensing agencies and bureaus. May prepare docket of cases to be called; secure information for judges and court; prepare draft agendas or bylaws for town or city council; answer official correspondence; keep fiscal records and accounts; issue licenses or permits; and record data, administer tests, or collect fees.', 'soc_code' => '43-4031.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '709', 'pos_name' => 'Court Clerks', 'pos_description' => 'Perform clerical duties in court of law; prepare docket of cases to be called; secure information for judges; and contact witnesses, attorneys, and litigants to obtain information for court.', 'soc_code' => '43-4031.01', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'court-clerk', 'is_active' => '1', 'def_title_id' => '10182', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '710', 'pos_name' => 'Municipal Clerks', 'pos_description' => 'Draft agendas and bylaws for town or city council; record minutes of council meetings; answer official correspondence; keep fiscal records and accounts; and prepare reports on civic needs.', 'soc_code' => '43-4031.02', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'municipa-clerk', 'is_active' => '1', 'def_title_id' => '26403', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '711', 'pos_name' => 'License Clerks', 'pos_description' => 'Issue licenses or permits to qualified applicants. Obtain necessary information, record data, advise applicants on requirements, collect fees, and issue licenses. May conduct oral, written, visual, or performance testing.', 'soc_code' => '43-4031.03', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'license', 'is_active' => '1', 'def_title_id' => '22831', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '712', 'pos_name' => 'Credit Authorizers, Checkers, and Clerks', 'pos_description' => 'Authorize credit charges against customers\' accounts. Investigate history and credit standing of individuals or business establishments applying for credit. May interview applicants to obtain personal and financial data; determine credit worthiness; process applications; and notify customers of acceptance or rejection of credit.', 'soc_code' => '43-4041.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '713', 'pos_name' => 'Credit Authorizers', 'pos_description' => 'Authorize credit charges against customers&#039; accounts.', 'soc_code' => '43-4041.01', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'credit-authorization', 'is_active' => '1', 'def_title_id' => '10327', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '714', 'pos_name' => 'Credit Checkers', 'pos_description' => 'Investigate history and credit standing of individuals or business establishments applying for credit. Telephone or write to credit departments of business and service establishments to obtain information about applicant&#039;s credit standing.', 'soc_code' => '43-4041.02', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'credit-verify', 'is_active' => '1', 'def_title_id' => '10361', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '715', 'pos_name' => 'Customer Service Representatives', 'pos_description' => 'Interact with customers to provide information in response to inquiries about products and services and to handle and resolve complaints.', 'soc_code' => '43-4051.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'customer-service', 'is_active' => '1', 'def_title_id' => '10798', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '716', 'pos_name' => 'Patient Representatives', 'pos_description' => 'Assist patients in obtaining services, understanding policies and making health care decisions.', 'soc_code' => '43-4051.03', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'patient-representation', 'is_active' => '1', 'def_title_id' => '28647', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '717', 'pos_name' => 'Government Program Eligibility Interviewers', 'pos_description' => 'Determine eligibility of persons applying to receive assistance from government programs and agency resources, such as welfare, unemployment benefits, social security, and public housing.', 'soc_code' => '43-4061.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'gov-eligibility', 'is_active' => '1', 'def_title_id' => '13799', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '718', 'pos_name' => 'File Clerks', 'pos_description' => 'File correspondence, cards, invoices, receipts, and other records in alphabetical or numerical order or according to the filing system used. Locate and remove material from file when requested.', 'soc_code' => '43-4071.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'filing', 'is_active' => '1', 'def_title_id' => '15306', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '719', 'pos_name' => 'Hotel, Motel, and Resort Desk Clerks', 'pos_description' => 'Accommodate hotel, motel, and resort patrons by registering and assigning rooms to guests, issuing room keys or cards, transmitting and receiving messages, keeping records of occupied rooms and guests&#039; accounts, making and confirming reservations, and presenting statements to and collecting payments from departing guests.', 'soc_code' => '43-4081.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'hotel-clerk', 'is_active' => '1', 'def_title_id' => '11475', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '720', 'pos_name' => 'Interviewers', 'pos_description' => 'Interview persons by telephone, mail, in person, or by other means for the purpose of completing forms, applications, or questionnaires. Ask specific questions, record answers, and assist persons with completing form. May sort, classify, and file forms.', 'soc_code' => '43-4111.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'interviewing', 'is_active' => '1', 'def_title_id' => '21329', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '721', 'pos_name' => 'Library Assistants, Clerical', 'pos_description' => 'Compile records, sort, shelve, issue, and receive library materials such as books, electronic media, pictures, cards, slides and microfilm. Locate library materials for loan and replace material in shelving area, stacks, or files according to identification number and title. Register patrons to permit them to borrow books, periodicals, and other library materials.', 'soc_code' => '43-4121.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'library-assistant', 'is_active' => '1', 'def_title_id' => '22797', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '722', 'pos_name' => 'Loan Interviewers and Clerks', 'pos_description' => 'Interview loan applicants to elicit information; investigate applicants&#039; backgrounds and verify references; prepare loan request papers; and forward findings, reports, and documents to appraisal department. Review loan papers to ensure completeness, and complete transactions between loan establishment, borrowers, and sellers upon approval of loan.', 'soc_code' => '43-4131.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'loan-interview', 'is_active' => '1', 'def_title_id' => '23313', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '723', 'pos_name' => 'New Accounts Clerks', 'pos_description' => 'Interview persons desiring to open accounts in financial institutions. Explain account services available to prospective customers and assist them in preparing applications.', 'soc_code' => '43-4141.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'new-accounts', 'is_active' => '1', 'def_title_id' => '26830', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '724', 'pos_name' => 'Order Clerks', 'pos_description' => 'Receive and process incoming orders for materials, merchandise, classified ads, or services such as repairs, installations, or rental of facilities. Generally receives orders via mail, phone, fax, or other electronic means. Duties include informing customers of receipt, prices, shipping dates, and delays; preparing contracts; and handling complaints.', 'soc_code' => '43-4151.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'order-clerk', 'is_active' => '1', 'def_title_id' => '27740', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '725', 'pos_name' => 'Human Resources Assistants, Except Payroll and Timekeeping', 'pos_description' => 'Compile and keep personnel records. Record data for each employee, such as address, weekly earnings, absences, amount of sales or production, supervisory reports, and date of and reason for termination. May prepare reports for employment records, file employment records, or search employee files and furnish information to authorized persons.', 'soc_code' => '43-4161.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'hr-assistance', 'is_active' => '1', 'def_title_id' => '20190', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '726', 'pos_name' => 'Receptionists and Information Clerks', 'pos_description' => 'Answer inquiries and provide information to the general public, customers, visitors, and other interested parties regarding activities conducted at establishment and location of departments, offices, and employees within the organization.', 'soc_code' => '43-4171.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'reception', 'is_active' => '1', 'def_title_id' => '32560', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '727', 'pos_name' => 'Reservation and Transportation Ticket Agents and Travel Clerks', 'pos_description' => 'Make and confirm reservations for transportation or lodging, or sell transportation tickets. May check baggage and direct passengers to designated concourse, pier, or track; deliver tickets, contact individuals and groups to inform them of package tours; or provide tourists with travel or transportation information.', 'soc_code' => '43-4181.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => 'reservation', 'is_active' => '1', 'def_title_id' => '33219', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '728', 'pos_name' => 'Information and Record Clerks, All Other', 'pos_description' => 'All information and record clerks not listed separately.', 'soc_code' => '43-4199.00', 'major_gid' => '17', 'minor_gid' => '62', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '729', 'pos_name' => 'Cargo and Freight Agents', 'pos_description' => 'Expedite and route movement of incoming and outgoing cargo and freight shipments in airline, train, and trucking terminals, and shipping docks. Take orders from customers and arrange pickup of freight and cargo for delivery to loading platform. Prepare and examine bills of lading to determine shipping charges and tariffs.', 'soc_code' => '43-5011.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => 'cargo', 'is_active' => '1', 'def_title_id' => '6181', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '730', 'pos_name' => 'Freight Forwarders', 'pos_description' => 'Research rates, routings, or modes of transport for shipment of products. Maintain awareness of regulations affecting the international movement of cargo. Make arrangements for additional services, such as storage or inland transportation.', 'soc_code' => '43-5011.01', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => 'freight-forwarder', 'is_active' => '1', 'def_title_id' => '16677', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '731', 'pos_name' => 'Couriers and Messengers', 'pos_description' => 'Pick up and deliver messages, documents, packages, and other items between offices or departments within an establishment or directly to other business concerns, traveling by foot, bicycle, motorcycle, automobile, or public conveyance.', 'soc_code' => '43-5021.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => 'delivery', 'is_active' => '1', 'def_title_id' => '10173', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '732', 'pos_name' => 'Police, Fire, and Ambulance Dispatchers', 'pos_description' => 'Operate radio, telephone, or computer equipment at emergency response centers. Receive reports from the public of crimes, disturbances, fires, and medical or police emergencies. Relay information to law enforcement and emergency response personnel. May maintain contact with caller until responders arrive.', 'soc_code' => '43-5031.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '733', 'pos_name' => 'Dispatchers, Except Police, Fire, and Ambulance', 'pos_description' => 'Schedule and dispatch workers, work crews, equipment, or service vehicles for conveyance of materials, freight, or passengers, or for normal installation, service, or emergency repairs rendered outside the place of business. Duties may include using radio, telephone, or computer to transmit assignments and compiling statistics and reports on work progress.', 'soc_code' => '43-5032.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => 'dispatch', 'is_active' => '1', 'def_title_id' => '12113', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '734', 'pos_name' => 'Meter Readers, Utilities', 'pos_description' => 'Read meter and record consumption of electricity, gas, water, or steam.', 'soc_code' => '43-5041.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '735', 'pos_name' => 'Postal Service Clerks', 'pos_description' => 'Perform any combination of tasks in a post office, such as receive letters and parcels; sell postage and revenue stamps, postal cards, and stamped envelopes; fill out and sell money orders; place mail in pigeon holes of mail rack or in bags; and examine mail for correct postage.', 'soc_code' => '43-5051.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '736', 'pos_name' => 'Postal Service Mail Carriers', 'pos_description' => 'Sort mail for delivery. Deliver mail on established route by vehicle or on foot.', 'soc_code' => '43-5052.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '737', 'pos_name' => 'Postal Service Mail Sorters, Processors, and Processing Machine Operators', 'pos_description' => 'Prepare incoming and outgoing mail for distribution. Examine, sort, and route mail. Load, operate, and occasionally adjust and repair mail processing, sorting, and canceling machinery. Keep records of shipments, pouches, and sacks; and other duties related to mail handling within the postal service.', 'soc_code' => '43-5053.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '738', 'pos_name' => 'Production, Planning, and Expediting Clerks', 'pos_description' => 'Coordinate and expedite the flow of work and materials within or between departments of an establishment according to production schedule. Duties include reviewing and distributing production, work, and shipment schedules; conferring with department supervisors to determine progress of work and completion dates; and compiling reports on progress of work, inventory levels, costs, and production problems.', 'soc_code' => '43-5061.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => 'planning', 'is_active' => '1', 'def_title_id' => '29746', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '739', 'pos_name' => 'Shipping, Receiving, and Traffic Clerks', 'pos_description' => 'Verify and maintain records on incoming and outgoing shipments. Prepare items for shipment. Duties include assembling, addressing, stamping, and shipping merchandise or material; receiving, unpacking, verifying and recording incoming merchandise or material; and arranging for the transportation of products.', 'soc_code' => '43-5071.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => 'shipping', 'is_active' => '1', 'def_title_id' => '35641', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '740', 'pos_name' => 'Stock Clerks and Order Fillers', 'pos_description' => 'Receive, store, and issue sales floor merchandise, materials, equipment, and other items from stockroom, warehouse, or storage yard to fill shelves, racks, tables, or customers\' orders. May mark prices on merchandise and set up sales displays.', 'soc_code' => '43-5081.00', 'major_gid' => '17', 'minor_gid' => '63', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
