            array('id' => '775', 'pos_name' => 'Farmworkers and Laborers, Crop', 'pos_description' => 'Manually plant, cultivate, and harvest vegetables, fruits, nuts and field crops. Use hand tools, such as shovels, trowels, hoes, tampers, pruning hooks, shears, and knives. Duties may include tilling soil and applying fertilizers; transplanting, weeding, thinning, or pruning crops; applying pesticides; cleaning, packing, and loading harvested products. May construct trellises, repair fences and farm buildings, or participate in irrigation activities.', 'soc_code' => '45-2092.02', 'major_gid' => '18', 'minor_gid' => '67', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '776', 'pos_name' => 'Farmworkers, Farm, Ranch, and Aquacultural Animals', 'pos_description' => 'Attend to live farm, ranch, or aquacultural animals that may include cattle, sheep, swine, goats, horses and other equines, poultry, finfish, shellfish, and bees. Attend to animals produced for animal products, such as meat, fur, skins, feathers, eggs, milk, and honey. Duties may include feeding, watering, herding, grazing, castrating, branding, de-beaking, weighing, catching, and loading animals. May maintain records on animals; examine animals to detect diseases and injuries; assist in birth deliveries; and administer medications, vaccinations, or insecticides as appropriate. May clean and maintain animal housing areas. Includes workers who shear wool from sheep, and collect eggs in hatcheries.', 'soc_code' => '45-2093.00', 'major_gid' => '18', 'minor_gid' => '67', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
