            array('id' => '780', 'pos_name' => 'Forest and Conservation Workers', 'pos_description' => 'Under supervision, perform manual labor necessary to develop, maintain, or protect areas such as forests, forested areas, woodlands, wetlands, and rangelands through such activities as raising and transporting seedlings; combating insects, pests, and diseases harmful to plant life; and building structures to control water, erosion, and leaching of soil. Includes forester aides, seedling pullers, and tree planters.', 'soc_code' => '45-4011.00', 'major_gid' => '18', 'minor_gid' => '69', 'url_desc' => 'forest-worker', 'is_active' => '1', 'def_title_id' => '16437', 'created_at' => NULL, 'updated_at' => NULL),
