            array('id' => '1056', 'pos_name' => 'Sailors and Marine Oilers', 'pos_description' => 'Stand watch to look for obstructions in path of vessel, measure water depth, turn wheel on bridge, or use emergency equipment as directed by captain, mate, or pilot. Break out, rig, overhaul, and store cargo-handling gear, stationary rigging, and running gear. Perform a variety of maintenance tasks to preserve the painted surface of the ship and to maintain line and ship equipment. Must hold government-issued certification and tankerman certification when working aboard liquid-carrying vessels. Includes able seamen and ordinary seamen.', 'soc_code' => '53-5011.00', 'major_gid' => '22', 'minor_gid' => '92', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1057', 'pos_name' => 'Captains, Mates, and Pilots of Water Vessels', 'pos_description' => 'Command or supervise operations of ships and water vessels, such as tugboats and ferryboats. Required to hold license issued by U.S. Coast Guard.', 'soc_code' => '53-5021.00', 'major_gid' => '22', 'minor_gid' => '92', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
