            array('id' => '1084', 'pos_name' => 'Gas Compressor and Gas Pumping Station Operators', 'pos_description' => 'Operate steam, gas, electric motor, or internal combustion engine driven compressors. Transmit, compress, or recover gases, such as butane, nitrogen, hydrogen, and natural gas.', 'soc_code' => '53-7071.00', 'major_gid' => '22', 'minor_gid' => '94', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1085', 'pos_name' => 'Pump Operators, Except Wellhead Pumpers', 'pos_description' => 'Tend, control, or operate power-driven, stationary, or portable pumps and manifold systems to transfer gases, oil, other liquids, slurries, or powdered materials to and from various vessels and processes.', 'soc_code' => '53-7072.00', 'major_gid' => '22', 'minor_gid' => '94', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1086', 'pos_name' => 'Wellhead Pumpers', 'pos_description' => 'Operate power pumps and auxiliary equipment to produce flow of oil or gas from wells in oil field.', 'soc_code' => '53-7073.00', 'major_gid' => '22', 'minor_gid' => '94', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
