            array('id' => '1088', 'pos_name' => 'Mine Shuttle Car Operators', 'pos_description' => 'Operate diesel or electric-powered shuttle car in underground mine to transport materials from working face to mine cars or conveyor.', 'soc_code' => '53-7111.00', 'major_gid' => '22', 'minor_gid' => '94', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1089', 'pos_name' => 'Tank Car, Truck, and Ship Loaders', 'pos_description' => 'Load and unload chemicals and bulk solids, such as coal, sand, and grain into or from tank cars, trucks, or ships using material moving equipment. May perform a variety of other tasks relating to shipment of products. May gauge or sample shipping tanks and test them for leaks.', 'soc_code' => '53-7121.00', 'major_gid' => '22', 'minor_gid' => '94', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1090', 'pos_name' => 'Material Moving Workers, All Other', 'pos_description' => 'All material moving workers not listed separately.', 'soc_code' => '53-7199.00', 'major_gid' => '22', 'minor_gid' => '94', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1091', 'pos_name' => 'Air Crew Officers', 'pos_description' => 'Perform and direct in-flight duties to ensure the successful completion of combat, reconnaissance, transport, and search and rescue missions. Duties include operating aircraft communications and radar equipment, such as establishing satellite linkages and jamming enemy communications capabilities; operating aircraft weapons and defensive systems; conducting pre-flight, in-flight, and post-flight inspections of onboard equipment; and directing cargo and personnel drops.', 'soc_code' => '55-1011.00', 'major_gid' => '23', 'minor_gid' => '95', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1092', 'pos_name' => 'Aircraft Launch and Recovery Officers', 'pos_description' => 'Plan and direct the operation and maintenance of catapults, arresting gear, and associated mechanical, hydraulic, and control systems involved primarily in aircraft carrier takeoff and landing operations. Duties include supervision of readiness and safety of arresting gear, launching equipment, barricades, and visual landing aid systems; planning and coordinating the design, development, and testing of launch and recovery systems; preparing specifications for catapult and arresting gear installations; evaluating design proposals; determining handling equipment needed for new aircraft; preparing technical data and instructions for operation of landing aids; and training personnel in carrier takeoff and landing procedures.', 'soc_code' => '55-1012.00', 'major_gid' => '23', 'minor_gid' => '95', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1093', 'pos_name' => 'Armored Assault Vehicle Officers', 'pos_description' => 'Direct the operation of tanks, light armor, and amphibious assault vehicle units during combat situations on land or in aquatic environments. Duties include directing crew members in the operation of targeting and firing systems; coordinating the operation of advanced onboard communications and navigation equipment; directing the transport of personnel and equipment during combat; formulating and implementing battle plans, including the tactical employment of armored vehicle units; and coordinating with infantry, artillery, and air support units.', 'soc_code' => '55-1013.00', 'major_gid' => '23', 'minor_gid' => '95', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1094', 'pos_name' => 'Artillery and Missile Officers', 'pos_description' => 'Manage personnel and weapons operations to destroy enemy positions, aircraft, and vessels. Duties include planning, targeting, and coordinating the tactical deployment of field artillery and air defense artillery missile systems units; directing the establishment and operation of fire control communications systems; targeting and launching intercontinental ballistic missiles; directing the storage and handling of nuclear munitions and components; overseeing security of weapons storage and launch facilities; and managing maintenance of weapons systems.', 'soc_code' => '55-1014.00', 'major_gid' => '23', 'minor_gid' => '95', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1095', 'pos_name' => 'Command and Control Center Officers', 'pos_description' => 'Manage the operation of communications, detection, and weapons systems essential for controlling air, ground, and naval operations. Duties include managing critical communication links between air, naval, and ground forces; formulating and implementing emergency plans for natural and wartime disasters; coordinating emergency response teams and agencies; evaluating command center information and need for high-level military and government reporting; managing the operation of surveillance and detection systems; providing technical information and advice on capabilities and operational readiness; and directing operation of weapons targeting, firing, and launch computer systems.', 'soc_code' => '55-1015.00', 'major_gid' => '23', 'minor_gid' => '95', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1096', 'pos_name' => 'Infantry Officers', 'pos_description' => 'Direct, train, and lead infantry units in ground combat operations. Duties include directing deployment of infantry weapons, vehicles, and equipment; directing location, construction, and camouflage of infantry positions and equipment; managing field communications operations; coordinating with armor, artillery, and air support units; performing strategic and tactical planning, including battle plan development; and leading basic reconnaissance operations.', 'soc_code' => '55-1016.00', 'major_gid' => '23', 'minor_gid' => '95', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1097', 'pos_name' => 'Special Forces Officers', 'pos_description' => 'Lead elite teams that implement unconventional operations by air, land, or sea during combat or peacetime. These activities include offensive raids, demolitions, reconnaissance, search and rescue, and counterterrorism. In addition to their combat training, special forces officers often have specialized training in swimming, diving, parachuting, survival, emergency medicine, and foreign languages. Duties include directing advanced reconnaissance operations and evaluating intelligence information; recruiting, training, and equipping friendly forces; leading raids and invasions on enemy territories; training personnel to implement individual missions and contingency plans; performing strategic and tactical planning for politically sensitive missions; and operating sophisticated communications equipment.', 'soc_code' => '55-1017.00', 'major_gid' => '23', 'minor_gid' => '95', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1098', 'pos_name' => 'Military Officer Special and Tactical Operations Leaders, All Other', 'pos_description' => 'All military officer special and tactical operations leaders not listed separately.', 'soc_code' => '55-1019.00', 'major_gid' => '23', 'minor_gid' => '95', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1099', 'pos_name' => 'First-Line Supervisors of Air Crew Members', 'pos_description' => 'Supervise and coordinate the activities of air crew members. Supervisors may also perform the same activities as the workers they supervise.', 'soc_code' => '55-2011.00', 'major_gid' => '23', 'minor_gid' => '96', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1100', 'pos_name' => 'First-Line Supervisors of Weapons Specialists/Crew Members', 'pos_description' => 'Supervise and coordinate the activities of weapons specialists/crew members. Supervisors may also perform the same activities as the workers they supervise.', 'soc_code' => '55-2012.00', 'major_gid' => '23', 'minor_gid' => '96', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1101', 'pos_name' => 'First-Line Supervisors of All Other Tactical Operations Specialists', 'pos_description' => 'Supervise and coordinate the activities of all other tactical operations specialists not classified separately above. Supervisors may also perform the same activities as the workers they supervise.', 'soc_code' => '55-2013.00', 'major_gid' => '23', 'minor_gid' => '96', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
            array('id' => '1102', 'pos_name' => 'Air Crew Members', 'pos_description' => 'Perform in-flight duties to ensure the successful completion of combat, reconnaissance, transport, and search and rescue missions. Duties include operating aircraft communications and detection equipment, including establishing satellite linkages and jamming enemy communications capabilities; conducting pre-flight, in-flight, and post-flight inspections of onboard equipment; operating and maintaining aircraft weapons and defensive systems; operating and maintaining aircraft in-flight refueling systems; executing aircraft safety and emergency procedures; computing and verifying passenger, cargo, fuel, and emergency and special equipment weight and balance data; and conducting cargo and personnel drops.', 'soc_code' => '55-3011.00', 'major_gid' => '23', 'minor_gid' => '97', 'url_desc' => '', 'is_active' => '0', 'def_title_id' => '0', 'created_at' => NULL, 'updated_at' => NULL),
